import React from "react";
import { gapi } from "gapi-script";

useEffect(() => {
  function start() {
    gapi.client.init({
      clientId: process.env.REACT_PUBLIC_GOOGLE_CLIENT_ID,
      scope: "email",
    });
  }

  gapi.load("client:auth2", start);
}, []);

export default GoogleAuth;
